import React from 'react';
import './Button.css'
import { Container, Row, Col } from 'react-bootstrap';

const Button = ({num}) => {
  return (
    <Container className="justify-content-center h-100 w-100 ">
      <Row >
        <Col xs={8} lg={6} style={{ width: "15rem", height: "15rem" }}
          className="mt-4 rounded-circle bigButton">
          {num}
        </Col>
      </Row>
    </Container>
  );
}

export default Button;
